import { View, Text, SafeAreaView } from "react-native";
import React, { useLayoutEffect } from "react";
import { useNavigation } from "@react-navigation/native";

const HomeScreen = () => {
  const navigation = useNavigation();

  useLayoutEffect(() => {
    navigation.setOptions({
      headerShown: false,
    });
  }, []);

  return (
    <SafeAreaView className="w-screen flex flex-col items-center">
      <View className="bg-pink-200 flex flex-col w-screen md:container md:mx-auto sm:flex-row items-center py-5 h-1/3">
        <Text className="container text-center bg-gray-400 mx-1">LOGO</Text>
        <Text className="container text-center bg-gray-400 mx-1">LOGO</Text>
      </View>
    </SafeAreaView>
  );
};

export default HomeScreen;
